      mode: myMode,
        
      ali:{
        main:"#647488",
        conttrastText:"#fff"
      }
    },
  });*/
  return (
    <>
    <ThemeProvider theme={darkTheme}>
      <CssBaseline />

      <div>

        <Navbar drawerWidth={drawerWidth} setmyMode= {setmyMode}/>
             
            <Box componant="main" sx={{ml: `${drawerWidth}px` , display:"flex" ,justifyContent:"center", mt:"66px"}}>

    <Outlet  />
    </Box>
      </div>

    </ThemeProvider>
      
    </>
  )
}



export default Layout
